(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["changelog"],{f522:function(n,e,d){"use strict";d.r(e);var t=function(){var n=this,e=n._self._c;n._self._setupProxy;return e("div",{staticClass:"markdown-body",domProps:{innerHTML:n._s(n.html)}})},s=[],a=d("9ab4"),i=d("1b40"),o="# Changelog\n\n本程序所有变更历史都将记录于本文档，方便大家了解更新内容及规划。\n\n该文档基于[更新日志](https://keepachangelog.com/zh-CN/1.0.0/)编写，版本号遵循[语义化版本](https://semver.org/)\n\n## [Unreleased]\n\n### Added\n\n- [ ] 内置常用字及文章\n- [ ] 文件载文\n- [ ] 速度练习\n\n## [1.3.3] - 2021-08-08\n\n### Added\n\n- 新增“手动载文”功能，当剪切板被禁用时可以使用该功能载文\n- 新增赛文跟打界面文章及输入框行数设置\n\n### Changed\n\n- 成绩栏中增加“错字”及“重打次数”两个属性\n\n### Fixed\n\n- 速度数据异常[#I3Y138]\n- 标点设置删完后无法添加[#I43XWB]\n\n## [1.3.2] - 2021-06-27\n\n### Added\n\n- 新增赛文字号设置[#I3W2IC]\n\n### Changed\n\n- 优化赛文开打时统计数据巨大问题[#I3UA2M]\n\n## [1.3.1] - 2021-05-23\n\n### Added\n\n- 新增“最后一次上屏无错”结束条件[#I3RAWX]\n- 新增“赛文字体设置”可以指定本机的字体[#I3RAXE]\n- 新增“禁用单字提示”设置[#I3RAWT]\n\n### Changed\n\n- 恢复2行赛文结构的载文[#I3RAWN]\n\n### Fixed\n\n- 成绩中`回改`始终和`打词`相同问题[#I3RAW9]\n- 成绩中`右手`键数统计不正确问题[#I3RAXZ]\n- F3失效问题[#I3RAXL]\n- 优化`键准`统计算法，被回车或CapsLock等清空的编码也计入无效编码[#I3RAXS]\n- 解决标点顶屏导致的打词率不准确问题[#I3RAX6]\n\n## [1.3.0] - 2021-04-24\n\n### Added\n\n- 增加字数统计功能，统计“今日打字数”，“累计打字数”，“连续打字天数”和“累计打字天数”\n\n### Changed\n\n- 禁用`F3`、`Enter`和`Esc`按键的默认行为\n\n### Fixed\n\n- 解决`ligature`导致的错误信息无法显示问题[#I3F3WE](https://gitee.com/hotleave/quick-typing/issues/I3F3WE)\n\n## [1.2.2] - 2021-03-31\n\n### Changed\n\n- 修改字体，保证输入区和对照区字体一致\n\n## [1.2.1] - 2021-03-30\n\n### Added\n\n- 增加赛文结束方式设置，默认为“无错误” [#I3CIS2](https://gitee.com/hotleave/quick-typing/issues/I3CIS2)\n- 成绩中增加`错字`选项，默认不选\n\n### Fixed\n\n- 码表设置在未开启词语提示时不显示问题\n- 载文中带有额外的换行导致无法解析问题 [#I3CJFQ](https://gitee.com/hotleave/quick-typing/issues/I3CJFQ)\n- 统计页面刷新后无数据问题 [#I3E7YY](https://gitee.com/hotleave/quick-typing/issues/I3E7YY)\n\n## [1.2.0] - 2021-03-25\n\n### Added\n\n- 抽取词库中特定的词条进行练习，达到指定速度后\n\n### Changed\n\n- 将码表设置从词语提示中独立出来\n\n## [1.1.2] - 2021-03-22\n\n### Added\n\n- 增加`自动重新开始`设置，当删除输入的所有文字后自动重新开始\n- 输入框下增加历史结果，显示最近10次记录，展开可查看明细\n\n### Changed\n\n- 赛文结果改为`message`通知\n\n### Fixed\n\n- 解决开启`编码提示`后文章展示错误问题\n\n## [1.1.1] - 2021-03-19\n\n### Fixed\n\n- 修复编码提示在最后几个字时出错问题\n- 修复设置中最大候选词位置不生效问题\n- 优化复制到剪切板操作，增强兼容性\n\n## [1.1.0] - 2021-03-19\n\n### Added\n\n- 对接[小拆][xiaochai]接口，支持小拆账号登录及加载群赛文\n- 面板中增加`词提`和`替换空格`快捷开关\n- 面板中编码提示中增加当前字之后15个字内的所有词提示，排第一个的为最佳方案\n\n### Changed\n\n- 程序界面宽度限制到1440px以内，防止过宽看起来不方便\n\n## [1.0.2] - 2021-03-15\n\n### Added\n\n- 统计页面中新增手指使用率\n\n### Changed\n\n- 热图中不再统计`Backspace`\n\n### Fixed\n\n- 修复`y`,`u`,`i`,`o`,`p`,`v`,`c`手指分布错误\n\n## [1.0.1] - 2021-03-13\n\n### Added\n\n- 成绩中增加[小拆][xiaochai]`哈希码`，默认不选择\n- 成绩中增加`暂停时间`，默认不选择\n- 新增赛文信息展示，段落、标题、字数\n- 新增Changelog\n\n### Changed\n\n- 优化赛文对照区自动滚动算法\n\n### Security\n\n- 载文时校验小拆验证码，防止赛文被篡改\n\n## [1.0.0] - 2021-03-10\n\n### Added\n\n- 手动剪切板载文\n- 赛文跟打\n- 用是否加粗方式进行词语提示\n- 码长提示，用不同颜色代表相应码长的词语\n- 编码提示，包括单字及词语\n- 选重提示及标点顶屏提示\n- 理论码长及对应理想码长词语提示\n- 理想码长对应的编码展示\n- 跟打成绩自动复制到剪切板\n- 按键统计图\n\n[xiaochai]: https://xc.cool/",c=d("339e"),h=d.n(c);const g=new h.a.Converter;g.setOption("tables",!0),g.setOption("tasklists",!0);let l=class extends i["c"]{get html(){return g.makeHtml(o)}};l=Object(a["a"])([i["a"]],l);var p=l,I=p,r=d("2877"),u=Object(r["a"])(I,t,s,!1,null,null,null);e["default"]=u.exports}}]);